import React, { useEffect } from 'react';
import { Link } from 'react-router-dom';
import { AppBar, Tabs, Tab, TabPanel, Typography, Box, Paper } from '@material-ui/core';
import service from '../services/CourseService';
import theme from '../theme/theme';
import { makeStyles } from '@material-ui/core/styles';

/**
 * MyPortfolio
 * @Author Holland Aucoin
 * 
 * Projects Tabular
 * @Summary This component displays the tabular view of all projects that is shown on the projects page
 */

const useStyles = makeStyles(() => ({
    root: {
        flexGrow: 1,
      },
}));


export default function App() {

  const classes = useStyles();
  const [value, setValue] = React.useState(0);

  const handleChange = (event, newValue) => {
    setValue(newValue);
  };


  return (

    <Paper className={classes.root}>
        <AppBar position="static" color="default">
      <Tabs
        value={value}
        onChange={handleChange}
        indicatorColor="primary"
        textColor="primary"
        centered
      >
        <Tab label="Item One" />
        <Tab label="Item Two" />
        <Tab label="Item Three" />
      </Tabs>
      </AppBar>
      <TabPanel value={value} index={0} dir={theme.direction}>
          Item One
        </TabPanel>
        <TabPanel value={value} index={1} dir={theme.direction}>
          Item Two
        </TabPanel>
        <TabPanel value={value} index={2} dir={theme.direction}>
          Item Three
        </TabPanel>
    </Paper>

  )
}
